SELECT t1.ca_county, t1.d_year, t13.web_sales / t10.web_sales AS web_q1_q2_increase, t4.store_sales / t1.store_sales AS store_q1_q2_increase, t16.web_sales / t13.web_sales AS web_q2_q3_increase, t7.store_sales / t4.store_sales AS store_q2_q3_increase FROM (SELECT customer_address.ca_county, date_dim.d_qoy, date_dim.d_year, SUM(store_sales.ss_ext_sales_price) AS store_sales FROM store_sales INNER JOIN date_dim ON store_sales.ss_sold_date_sk = date_dim.d_date_sk INNER JOIN customer_address ON store_sales.ss_addr_sk = customer_address.ca_address_sk GROUP BY customer_address.ca_county, date_dim.d_qoy, date_dim.d_year HAVING date_dim.d_qoy = 1 AND date_dim.d_year = 1999) AS t1 INNER JOIN (SELECT customer_address0.ca_county, date_dim0.d_qoy, date_dim0.d_year, SUM(store_sales0.ss_ext_sales_price) AS store_sales FROM store_sales AS store_sales0 INNER JOIN date_dim AS date_dim0 ON store_sales0.ss_sold_date_sk = date_dim0.d_date_sk INNER JOIN customer_address AS customer_address0 ON store_sales0.ss_addr_sk = customer_address0.ca_address_sk GROUP BY customer_address0.ca_county, date_dim0.d_qoy, date_dim0.d_year HAVING date_dim0.d_qoy = 2 AND date_dim0.d_year = 1999) AS t4 ON t1.ca_county = t4.ca_county INNER JOIN (SELECT customer_address1.ca_county, date_dim1.d_qoy, date_dim1.d_year, SUM(store_sales1.ss_ext_sales_price) AS store_sales FROM store_sales AS store_sales1 INNER JOIN date_dim AS date_dim1 ON store_sales1.ss_sold_date_sk = date_dim1.d_date_sk INNER JOIN customer_address AS customer_address1 ON store_sales1.ss_addr_sk = customer_address1.ca_address_sk GROUP BY customer_address1.ca_county, date_dim1.d_qoy, date_dim1.d_year HAVING date_dim1.d_qoy = 3 AND date_dim1.d_year = 1999) AS t7 ON t4.ca_county = t7.ca_county INNER JOIN (SELECT customer_address2.ca_county, date_dim2.d_qoy, date_dim2.d_year, SUM(web_sales.ws_ext_sales_price) AS web_sales FROM web_sales INNER JOIN date_dim AS date_dim2 ON web_sales.ws_sold_date_sk = date_dim2.d_date_sk INNER JOIN customer_address AS customer_address2 ON web_sales.ws_bill_addr_sk = customer_address2.ca_address_sk GROUP BY customer_address2.ca_county, date_dim2.d_qoy, date_dim2.d_year HAVING date_dim2.d_qoy = 1 AND date_dim2.d_year = 1999) AS t10 ON t1.ca_county = t10.ca_county INNER JOIN (SELECT customer_address3.ca_county, date_dim3.d_qoy, date_dim3.d_year, SUM(web_sales0.ws_ext_sales_price) AS web_sales FROM web_sales AS web_sales0 INNER JOIN date_dim AS date_dim3 ON web_sales0.ws_sold_date_sk = date_dim3.d_date_sk INNER JOIN customer_address AS customer_address3 ON web_sales0.ws_bill_addr_sk = customer_address3.ca_address_sk GROUP BY customer_address3.ca_county, date_dim3.d_qoy, date_dim3.d_year HAVING date_dim3.d_qoy = 2 AND date_dim3.d_year = 1999) AS t13 ON t10.ca_county = t13.ca_county AND CASE WHEN t10.web_sales > 0 THEN t13.web_sales / t10.web_sales ELSE NULL END > CASE WHEN t1.store_sales > 0 THEN t4.store_sales / t1.store_sales ELSE NULL END INNER JOIN (SELECT customer_address4.ca_county, date_dim4.d_qoy, date_dim4.d_year, SUM(web_sales1.ws_ext_sales_price) AS web_sales FROM web_sales AS web_sales1 INNER JOIN date_dim AS date_dim4 ON web_sales1.ws_sold_date_sk = date_dim4.d_date_sk INNER JOIN customer_address AS customer_address4 ON web_sales1.ws_bill_addr_sk = customer_address4.ca_address_sk GROUP BY customer_address4.ca_county, date_dim4.d_qoy, date_dim4.d_year HAVING date_dim4.d_qoy = 3 AND date_dim4.d_year = 1999) AS t16 ON t10.ca_county = t16.ca_county AND CASE WHEN t13.web_sales > 0 THEN CAST(t16.web_sales / t13.web_sales AS DECIMAL(19, 0)) ELSE NULL END > CASE WHEN t4.store_sales > 0 THEN CAST(t7.store_sales / t4.store_sales AS DECIMAL(19, 0)) ELSE NULL END ORDER BY t7.store_sales / t4.store_sales